import React from 'react';

function DefenseVote(props) {
    let yesButton = '';
    let noButton = '';
    if(!props.gameOver){
        yesButton = <button onClick={() => props.defenseVote('yes')} >Yes</button>
        noButton = <button onClick={() => props.defenseVote('no')} >No</button>
    }
    return (
        <div>
            {yesButton}
            {noButton}
        </div>
    );
}

export default DefenseVote;
